import React, { Component } from 'react';
import './App.css';

class App extends Component {

  constructor() {
    super();

    this.state = {
      monsters: [
      {
        name: 'Frankenstein',
        id: 'aaa'
      },
      {
        name: 'Dracula',
        id: 'bbb'

      },
      {
        name: 'Zombie',
        id: 'ccc'

      }
      ]
    }
  }

  componentDidMount() {
    fetch('http://jsonplaceholder.typicode.com/users')
    .then(response => response.json())
  }

  render(){
    return (
      <div className="App">
        {
          this.state.monsters.map( monster => 
            <h1 key={monster.id}> 
              { monster.name } 
            </h1>
          )
        }
      </div>
    );

  }

}
export default App;
